import React from 'react';
import { Link } from 'react-router-dom';
import '../stylesheets/Articles.css';

function Articles() {
  const articles = [
    {
      id: 1,
      title: 'My First Article',
      date: 'March 21, 2023',
      excerpt:
        'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed vitae diam quam. Integer non facilisis orci. Donec sit amet varius lorem.',
    },
    {
      id: 2,
      title: 'My Second Article',
      date: 'April 1, 2023',
      excerpt:
        'Phasellus sollicitudin malesuada cursus. Proin ut sem nec mauris pellentesque tincidunt. Nulla id est urna. Suspendisse euismod porttitor nulla.',
    },
  ];

  return (
    <div className="articles">
      {articles.map((article) => (
        <div className="article" key={article.id}>
          <h2 className="article-title">
            <Link to={`../articles/${article.id}`}>{article.title}</Link>
          </h2>
          <p className="article-meta">{article.date}</p>
          <div className="article-excerpt">{article.excerpt}</div>
        </div>
      ))}
    </div>
  );
}

export default Articles;
